INSERT INTO `movies` VALUES (1,'Deadpool and Wolverine','Superhero','The film follows Deadpool as he learns that the Time Variance Authority (TVA) plans to destroy his universe. He teams up with a reluctant Wolverine from another universe to stop them.','photos/Deadpool_&_Wolverine_poster.jpg'),(2,'Inception','Science-Fiction','Inception (2010) follows Dom Cobb (Leonardo DiCaprio), a thief who enters dreams to steal secrets. He\'s tasked with planting an idea in a target\'s mind, but as he dives deeper into dreams, he faces challenges from his own subconscious, especially memories of his wife. The film explores reality, memory, and guilt.','photos/inception.jpg'),(3,'Predestination','Science-Fiction','Predestination (2014) follows a time-traveling agent (Ethan Hawke) trying to stop a criminal known as the \"Fizzle Bomber.\" He recruits a young recruit (Sarah Snook) to help, leading to surprising twists about identity and time travel.','photos/predestination.jpg'),(4,'The Purge: Election Year','Horror','The Purge: Election Year is a dystopian action-horror film. It follows Leo Barnes as he protects Senator Charlie Roan, a presidential candidate targeted during the Purge. Roan’s mission to end the violent event puts her in the crosshairs of the corrupt New Founding Fathers.','photos/purge.jpg'),(5,'Mad Max: Fury Road','Action','In a post-apocalyptic wasteland, Max teams up with Furiosa to escape a tyrannical warlord. Together, they lead a daring chase across the desert. High-octane action and stunning visuals drive this story of survival and rebellion.','photos/madmax.png'),(6,'John Wick','Action','A retired hitman seeks vengeance after gangsters kill his dog and steal his car. His quest reignites his legendary reputation in the criminal underworld. Stylish action and relentless fights define this revenge tale.','photos/johnwick.jpg'),(7,'Get Out\n','Horror','Chris, a Black man, visits his white girlfriend’s family, uncovering a sinister secret. As bizarre events unfold, he discovers a shocking truth about their intentions. A tense and thought-provoking psychological horror.','photos/getout.jpg'),(8,'The Conjuring\n','Horror','Paranormal investigators Ed and Lorraine Warren help a family plagued by dark forces in their farmhouse. They face chilling events and a malevolent entity. Based on a true story, it delivers spine-tingling scares.','photos/conjuring.jpg'),(9,'Superbad','Comedy','Two high school friends embark on a wild night to get alcohol for a party. Their misadventures include awkward encounters, fake IDs, and cops. A hilarious and heartfelt look at teenage friendship.','photos/superbad.jpg'),(10,'The Grand Budapest Hotel','Comedy','A concierge at a luxurious hotel is framed for murder and goes on the run with his lobby boy. Together, they unravel a web of intrigue and theft. Wes Anderson’s quirky humor shines in this delightful caper.','photos/budapesthotel.jpg'),(11,'Blade Runner 2049','Sci-Fi','In a dystopian future, a replicant blade runner uncovers a secret that could disrupt society. His search leads him to Rick Deckard, missing for decades. A visually stunning exploration of humanity and identity.','photos/bladerunner.jpg'),(12,'Spider-Man: Into the Spider-Verse','Animation','Teen Miles Morales becomes Spider-Man and meets other Spider-People from alternate universes. Together, they battle a villain threatening all dimensions. A vibrant and innovative take on the superhero genre.','photos/spiderman.jpg'),(13,'Coco','Animation','Miguel, a young boy passionate about music, journeys to the Land of the Dead. He uncovers family secrets while pursuing his dream to become a musician. A heartfelt celebration of culture and family.','photos/coco.jpeg');
/*!40000 ALTER TABLE `movies` ENABLE KEYS */;
